import { StyleSheet, Text, View } from 'react-native';
import { Checkbox } from 'galio-framework';


export default function App() {
  return (
      < View >
          <Text>sa</Text>
          <Checkbox color="primary" label="Primary Checkbox" />
      < / View >
  );
}

const styles = StyleSheet.create({
  card:{
      textColor: 'blue',
  },
  container: {
    flex: 1,
